import React, { Component } from "react";
import axios from "axios";

export class Animation extends Component {
  state = {
    posts: [],
    isLoaded: false,
    category: "",
  };

  componentDidMount() {
    axios
      .get("/wp-json/wp/v2/posts")
      .then((res) =>
        this.setState({
          posts: res.data,
          isLoaded: true,
        })
      )
      .catch((err) => console.log(err));
  }

  render() {
    return <div>Animation</div>;
  }
}

export default Animation;
